export default function Card(props) {
    const {playerDetails} = props;
    return <>
            <div className="cards">
           <h1>{playerDetails.name}</h1>
           <img src="https://a.espncdn.com/combiner/i?img=/i/headshots/nba/players/full/3934719.png"></img>
           <p>{playerDetails.position}</p>
           <p>Minutes: {playerDetails.minutes}</p>
           </div>
           </>;
}
